import { Menu, Popover, Card, List, Avatar } from 'antd';
import { UserOutlined } from '@ant-design/icons';


const tabList = [
    {
        key: "latest",
        tab: "최근 본 구장"
    },
    {
        key: "info",
        tab: "회원정보"
    },
]
const contentList = {
    latest: <List></List>,
    info: <a></a>
};
const ProfileAvatar = () => {
    const CardTabs = (<Card
        tabList={tabList}
    // activeTabKey={}
    >
    </Card>);
    return (
        <Menu.Item key="profile">
            <Popover placement="bottom" trigger="hover" content={CardTabs}>
                <Avatar shape="square" icon={<UserOutlined />} />
            </Popover>
        </Menu.Item>
    );
}

export default ProfileAvatar;
